exports.about = () => { return `*「 O que é a Íris? 」*\n\n_Íris, inicialmente foi um projeto de "BOT" do Legião Z, usado para enviar nossas tabelas, regras, ou coisas parecidas, feita a praticamente 6 anos atrás pelo programador amador Lucas R. [KillovSky], subindo de regras a ideias de jogos, frases, etc._\n\n_Em 2019 com a criação de diversas API's de automatização e bots novos, surgiu a necessidade de mostrar que a dele existia a mais tempo, então transformando a Íris em uma inteligencia Artificial [Básica] capaz de usar tradutores, jornais, conversores, terminal e até mesmo a NASA e Wikipédia, ele alcançou esse objetivo._\n\n_Desde a sua criação, a Iris sempre usou Shell, SQL indo para NodeJS até chegar no ponto dela ser capaz de rodar "todas" as programações...pelo WhatsApp._\n\n_Um Bot, é algo construído por um humano para realizar coisas sozinho(a)._\n\n_Uma Inteligencia Artificial é o mesmo, a diferença e que ela é capaz de aprender e entender certas coisas como "Qual resposta devo enviar"._\n\n*「 Por que "Íris?" 」*\n\n_Isso foi um acidente, eu lhe dei o nome íris por instinto, mas quando eu soube o significado de Íris, me espantei e resolvi adotar esse sentido._\n\n_O nome Íris tem origem no grego Íris e, segundo Platão, deriva do verbo eiren, “dizer”, e significa “mensageira" ou "mensageira pela palavra”. Na mitologia grega Íris era uma deusa mensageira dos outros deuses e se manifestava como um arco-íris colorido no céu, simbolizando sua ligação entre o Céu e a Terra._\n\n*「 Como fazer uma "Íris" 」*\n\n_Bom, isso é complicado, e se você planeja fazer algo assim, você deve aprender a programar, escolha uma linguagem de programação (como as que eu disse acima) e pronto! Você saberá fazer uma "Íris", ou use a minha github → https://github.com/KillovSky/iris\n\n*「 Quem é Lucas R. - KillovSky? 」*\n\n_Não sou bom em me descrever, mas dar um passo é otimo, tenho 17 anos e sou um programador amador que nunca fez cursos, adoro jogar, ver anime e escrever, antes que se pergunte, sim, de códigos de programação a pequenos rascunhos de historias, voltando, sou uma pessoa viciada em tecnologia desde quando eu me lembro (criança, bem criança), como me falta um objetivo de vida, meta ou algo do tipo, tento me divertir criando coisas interessantes na visão de todos (talvez eu possa definir como busca pelo conhecimento) embora não sirva muito a mim, masss fico feliz que estão se divertindo com minha bot e espero que continue assim!_\n\n*Sugestões, saber mais, queixas, etc? Venha falar comigo no:* https://wa.me/+5518998044132` }
